import { css } from '@emotion/react';

const styles = css`
  .desktop {
    @media (min-width: 600px) {
      display: none; 
    }
  }

  .mobile {
    @media (max-width: 599px) {
      display: none;
    }
  }

  .main {
    @media (min-width: 600px) {
      padding-bottom: 5%;
    }
  }

  .last {
    @media (max-width: 599px) {
      margin-bottom: 20px;
      padding-bottom: 200px;
    }
  }

  &.grid > * {
    margin: 10px;
  }
`;

export default styles;
